import Header from "./components/Header";

function Router(){

    return(
    <BrowserRouter>
        <Switch>
           <Route  path='/'  />
           <Route  path='/confirmation' exact component={Confirmation} />
        </Switch>
    </BrowserRouter>
    )
}

export default Router;
